let secTimer = parcel.getFeatureById('secTimerDisplay') 
let minTimer = parcel.getFeatureById('minTimerDisplay') 
let secTimerLast = parcel.getFeatureById('secTimerDisplayLast') 
let minTimerLast = parcel.getFeatureById('minTimerDisplayLast') 
let secTimerLast2 = parcel.getFeatureById('secTimerDisplayLast2') 
let minTimerLast2 = parcel.getFeatureById('minTimerDisplayLast2') 
let secTimerFast = parcel.getFeatureById('secTimerDisplayFast') 
let msTimerFast = parcel.getFeatureById('msTimerDisplayFast') 
let minTimerFast = parcel.getFeatureById('minTimerDisplayFast') 
let lapCheckpoint = parcel.getFeatureById('lapCheckpoint')  
