let misfitHead1 = parcel.getFeatureById('misfitHead1')
let misfitHead2 = parcel.getFeatureById('misfitHead2')
let misfitHead3 = parcel.getFeatureById('misfitHead3')
let misfitHead4 = parcel.getFeatureById('misfitHead4')
let misfitHead5 = parcel.getFeatureById('misfitHead5')
let misfitHead6 = parcel.getFeatureById('misfitHead6')
let misfitHead7 = parcel.getFeatureById('misfitHead7')
let misfitHead8 = parcel.getFeatureById('misfitHead8')
let misfitHead9 = parcel.getFeatureById('misfitHead9')
let misfitHead10 = parcel.getFeatureById('misfitHead10')
let misfitHead11 = parcel.getFeatureById('misfitHead11')
let misfitHead12 = parcel.getFeatureById('misfitHead12')
let misfitHead13 = parcel.getFeatureById('misfitHead13')
let misfitHead14 = parcel.getFeatureById('misfitHead14')
let misfitHead15 = parcel.getFeatureById('misfitHead15')
let misfitHead16 = parcel.getFeatureById('misfitHead16')
let misfitHead17 = parcel.getFeatureById('misfitHead17')
let misfitHead18 = parcel.getFeatureById('misfitHead18')
let misfitHead19 = parcel.getFeatureById('misfitHead19')
let misfitHead20 = parcel.getFeatureById('misfitHead20')

var milsecInterval;
var minPassed = 0;
var secPassed = 0;
var milsecPassed = 0;
var minPassedFast = 0;
var secPassedFast = 0;
var milsecPassedFast = 0;
var currentTotalMilsec = 0;
var fastTotalMilsec;

feature.on('trigger', (e) => { 
  console.log('lapCheckpoint: ', lapCheckpoint );

  if(lapCheckpoint._content.text == "true"){

    misfitHead1.scale.set(1.25, 1.25, 1.25);
    misfitHead2.scale.set(1.25, 1.25, 1.25);
    misfitHead3.scale.set(1.25, 1.25, 1.25);
    misfitHead4.scale.set(1.25, 1.25, 1.25);
    misfitHead5.scale.set(1.25, 1.25, 1.25);
    misfitHead6.scale.set(1.25, 1.25, 1.25);
    misfitHead7.scale.set(1.25, 1.25, 1.25);
    misfitHead8.scale.set(1.25, 1.25, 1.25);
    misfitHead9.scale.set(1.25, 1.25, 1.25);
    misfitHead10.scale.set(1.25, 1.25, 1.25);
    misfitHead11.scale.set(1.25, 1.25, 1.25);
    misfitHead12.scale.set(1.25, 1.25, 1.25);
    misfitHead13.scale.set(1.25, 1.25, 1.25);
    misfitHead14.scale.set(1.25, 1.25, 1.25);
    misfitHead15.scale.set(1.25, 1.25, 1.25);
    misfitHead16.scale.set(1.25, 1.25, 1.25);
    misfitHead17.scale.set(1.25, 1.25, 1.25);
    misfitHead18.scale.set(1.25, 1.25, 1.25);
    misfitHead19.scale.set(1.25, 1.25, 1.25);
    misfitHead20.scale.set(1.25, 1.25, 1.25);                                   

    if(fastTotalMilsec == null){
      fastTotalMilsec = currentTotalMilsec;
    }        
    secTimerLast.set( { text: secPassed.toString() } )
    minTimerLast.set( { text: minPassed.toString() } )
    secTimerLast2.set( { text: secPassed.toString() } )
    minTimerLast2.set( { text: minPassed.toString() } )  

    if((minPassedFast  == 0 && secPassedFast == 0 && milsecPassedFast == 0 ) || 
      (currentTotalMilsec < fastTotalMilsec )){
      fastTotalMilsec = currentTotalMilsec;      

      secTimerFast.set( { text: secPassed.toString() } )
      minTimerFast.set( { text: minPassed.toString() } )
      msTimerFast.set( { text: fastTotalMilsec.toString() } )

      milsecPassedFast = milsecPassed; 
      secPassedFast = secPassed; 
      minPassedFast = minPassed;         
    }

    currentTotalMilsec = 0;
    milsecPassed = 0; 
    secPassed = 0; 
    minPassed = 0;   
    lapCheckpoint.set({ text: "false"});
    leftTrackFlag.set({ text: "false"});  
    resetLapStats();  
  }  

  if(leftTrackFlag._content.text == "true"){ 
      currentTotalMilsec = 0;
      milsecPassed = 0; 
      secPassed = 0; 
      minPassed = 0;   
      lapCheckpoint.set({ text: "false"});
      leftTrackFlag.set({ text: "false"});  
      resetLapStats(); 
    }

  if(!milsecInterval){ 
      currentTotalMilsec = 0;
      milsecPassed = 0; 
      secPassed = 0; 
      minPassed = 0;   
      lapCheckpoint.set({ text: "false"});
      leftTrackFlag.set({ text: "false"});  
      resetLapStats(); 
      milsecInterval= setInterval(updateTime, 1) 
    }
})

function updateTime(){  
  currentTotalMilsec ++

  if(milsecPassed > 31){
    secPassed++;
    milsecPassed= 0;    
    if(secPassed > 59){
      minPassed ++;
      milsecPassed= 0; 
      secPassed= 0;         
    }
  } else {
    milsecPassed++
  }
  secTimer.set( { text: secPassed.toString() } )
  minTimer.set( { text: minPassed.toString() } )
}

function resetLapStats(){
  itemsCollected.set( { text: '0' } );
}

let lapCheckpoint = parcel.getFeatureById('lapCheckpoint')

feature.on('trigger', (e) => { 
  lapCheckpoint.set({ text: "true"}); 
})

